   class MyDocument extends Document {
     render() {
       return (
         <Html>
           <Head>
             <link rel="icon" href="/favicon.ico" />
             {/* Add other head elements here */}
           </Head>
           <body>
             <Main />
             <NextScript />
           </body>
         </Html>
       );
     }
   }

   export default MyDocument;
   ```

3. **Clear Browser Cache**:
   Browsers often cache favicons aggressively. To see the updated favicon, you may need to clear your browser cache or open the site in an incognito/private window.

